import React,{useState,useEffect} from 'react'
import axios from 'axios';
function FetchData() {
    const [profile,setProfile]=useState([]);

    const getProfile=()=>{
        try{
            axios.get("https://localhost:5000/profile").then(res=>{
                let profiles=res.data;
                setProfile(profiles);
            })
        }catch(err){
            console.error(err);
        }    
         
    }
    useEffect(()=>{
        getProfile();
    });

  return (
    <div>FetchData</div>
  )
}

export default FetchData;
